package ManishLokesh.Neptune.v2.payment;import javax.persistence.Entity;import javax.persistence.GeneratedValue;import javax.persistence.GenerationType;import javax.persistence.Id;@Entitypublic class PaymentGateways {    @Id    @GeneratedValue(strategy = GenerationType.AUTO)    private Long id;    private String name;    public String getName() {        return name;    }    public void setName(String name) {        this.name = name;    }    @Override    public String toString() {        return "PaymentGateways{" +                "id=" + id +                ", name='" + name + '\'' +                ", gatewayLogo='" + gatewayLogo + '\'' +                ", isAvailable=" + isAvailable +                '}';    }    private String gatewayLogo;    private Boolean isAvailable;    public Long getId() {        return id;    }    public void setId(Long id) {        this.id = id;    }    public String getGatewayLogo() {        return gatewayLogo;    }    public void setGatewayLogo(String gatewayLogo) {        this.gatewayLogo = gatewayLogo;    }    public Boolean getAvailable() {        return isAvailable;    }    public void setAvailable(Boolean available) {        isAvailable = available;    }}